import React from 'react';
import { Text, View, StyleSheet, ScrollView, SafeAreaView, Button, Modal } from 'react-native';
import Boards from '../components/Boards'
import AddBoards from '../screens/AddBoard'

import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';

const handlebtnAddBoards = ({navigation}) => {
    navigation.navigate('MyModal');
}

function HomeScreen({ navigation }) {
    return (
        <SafeAreaView style={styles.container}>
            <Button title="Add Board" onPress={handlebtnAddBoards} />
            <AddBoards />
        </SafeAreaView>
    );
}

function ModalScreen({ navigation }) {
    return (
        <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
            <Text style={{ fontSize: 30 }}>This is a modal!</Text>
            <Button onPress={() => navigation.goBack()} title="Dismiss" />
        </View>
    );
}

function DetailsScreen() {
    return (
        <View>
            <Text>Details</Text>
        </View>
    );
}

const MainStack = createStackNavigator();
const RootStack = createStackNavigator();

function MainStackScreen() {
    return (
        <MainStack.Navigator>
            <MainStack.Screen name="Home" component={HomeScreen} />
            <MainStack.Screen name="Details" component={DetailsScreen} />
        </MainStack.Navigator>
    );
}


const ListBoard = () => {
